import React, { Component } from "react";
import { connect } from "react-redux"
class ShowDate extends Component {
    state = {
        li: ["A"],
    }
    render() {
        const data = this.state.li.map(data => data);
        console.log(data);
        return (
            <div>
                <h1>hello</h1>
            </div>
        );
    }
}
const mapStateToProps = (state) => {
    const d = this.state.li;
    d.push(state.data);
    this.setState({ li: d });
    return {
        data: state.data,
    };

}
export default connect(mapStateToProps)(ShowDate);
